import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-left">
        <Link to="/" className="navbar-logo">THE CONCERT</Link>
      </div>
      <ul className="navbar-links">
        <li><a href="#home">หน้าแรก</a></li>
        <li><a href="#concerts">คอนเสิร์ต</a></li>
        <li><a href="#note-club">โน๊ตคลับ</a></li>
        <li><a href="#artists">ศิลปิน</a></li>
        <li><a href="#promotions">โปรโมชั่น</a></li>
        <li><a href="#products">สินค้า</a></li>
        <li><a href="#news">ข่าวสาร</a></li>
        <li><a href="#business-customers">ลูกค้าธุรกิจ</a></li>
        <li><a href="#ticket-protection">บริการคุ้มครองบัตรการแสดง</a></li>
      </ul>

      <div className="navbar-actions">
        <Link to="/login" className="btn btn-primary">เข้าสู่ระบบ</Link>
        <Link to="/signup" className="btn btn-secondary">สมัครสมาชิก</Link>
      </div>
    </nav>
  );
};

export default Navbar;
